import "./App.css";
import Navbar from "./Components/Navbar/Navbar";
import { BrowserRouter, Routes, Route } from "react-router-dom";
import Shop from "./Pages/Shop";
import ShopCategory from "./Pages/ShopCategory";
import Product from "./Pages/Product";
import Cart from "./Pages/Cart";
import LoginSignup from "./Pages/LoginSignup";
import Footer from "./Components/Footer/Footer";
import men_banner from "./Components/Assets/banner_mens.png";
import women_banner from "./Components/Assets/banner_women.png";
import kid_banner from "./Components/Assets/banner_kids.png";
import cc_banner from "./Components/Assets/img/Cachar.logo.png";
import dbs_banner from "./Components/Assets/img/Don.Bosco.img.png";
import gc_banner from "./Components/Assets/img//GCcollege.png";
import vkv_banner from "./Components/Assets/img/KV.img.png";
import pvm_banner from "./Components/Assets/img/Mandir.img.png";
import nc_banner from "./Components/Assets/img/NC.img.png";
import rgjc_banner from "./Components/Assets/img/rm.img.png";

function App() {
  return (
    <div>
      <BrowserRouter>
        <Navbar />
        <Routes>
          <Route path="/" element={<Shop />} />
          <Route
            path="/mens"
            element={<ShopCategory banner={men_banner} category="men" />}
          />
          <Route
            path="/womens"
            element={<ShopCategory banner={women_banner} category="women" />}
          />
          <Route
            path="/kids"
            element={<ShopCategory banner={kid_banner} category="kid" />}
          />
          <Route
            path="/1"
            element={<ShopCategory banner={cc_banner} category="1" />}
          />
          <Route
            path="/2"
            element={<ShopCategory banner={dbs_banner} category="2" />}
          />
          <Route
            path="/3"
            element={<ShopCategory banner={gc_banner} category="3" />}
          />
          <Route
            path="/4"
            element={<ShopCategory banner={vkv_banner} category="4" />}
          />
          <Route
            path="/5"
            element={<ShopCategory banner={pvm_banner} category="5" />}
          />
          <Route
            path="/6"
            element={<ShopCategory banner={nc_banner} category="6" />}
          />
          <Route
            path="/7"
            element={<ShopCategory banner={rgjc_banner} category="7" />}
          />
          <Route path="/product" element={<Product />}>
            <Route path=":productId" element={<Product />} />
          </Route>
          <Route path="/cart" element={<Cart />} />
          <Route path="/login" element={<LoginSignup />} />
        </Routes>
        <Footer />
      </BrowserRouter>
    </div>
  );
}

export default App;
